          "id": "4a2cbc08233268cf38cc9b8854f3d35ef878b731",
          "message": "⬆️ micro: Update time to v0.3.42 (#1488)\n\nThis PR contains the following updates:\n\n| Package | Type | Update | Change |\n|---|---|---|---|\n| [time](https://time-rs.github.io)\n([source](https://redirect.github.com/time-rs/time)) |\nworkspace.dependencies | patch | `0.3.41` -> `0.3.42` |\n\n---\n\n### Release Notes\n\n<details>\n<summary>time-rs/time (time)</summary>\n\n###\n[`v0.3.42`](https://redirect.github.com/time-rs/time/blob/HEAD/CHANGELOG.md#0342-2025-08-31)\n\n[Compare\nSource](https://redirect.github.com/time-rs/time/compare/v0.3.41...v0.3.42)\n\n##### Added\n\n- `Time::duration_until`\n- `Time::duration_since`\n- `per_t` method for all types in `time::convert`. This is similar to\nthe existing `per` method, but\ncan return any of the primitive numeric types that can represent the\nresult. This will cut down on\n`as` casts while ensuring correctness. Type inference isn't perfect, so\nyou may need to provide a\n  type annotation in some situations.\n- `impl PartialOrd for Month` and `impl Ord for Month`; this assumes the\nmonths are in the same year\n- `SystemTimeExt` trait, adding methods for checked arithmetic with\n`time::Duration` and obtaining\n  the difference between two `SystemTime`s as a `time::Duration`\n- Permit using `UtcDateTime` with `rand` (this was inadvertently omitted\npreviously)\n- `impl core::error::Error` for all error types (now available when the\n`std` feature is disabled)\n- MacOS can now obtain the local UTC offset in multi-threaded programs\nas the system APIs are\n  thread-safe.\n- `#[track_caller]` has been added to all relevant methods.\n\n##### Changed\n\n- The minimum supported Rust version is now 1.81.0.\n- The dependency on `itoa` has been removed, as the standard library now\nhas similar functionality\n  by default.\n- Formatting a component that involves a floating point number is now\nguaranteed to be\ndeterministic, avoiding any subtle differences between platforms or\ncompiler versions.\n\n##### Fixed\n\n- Serializing timestamps with nanosecond precision *should* always emit\nthe correct value.\nPreviously, it could be off by one nanosecond due to floating point\nimprecision.\n- A previously unknown bug in `OffsetDateTime::to_offset` and\n`UtcDateTime::to_offset` has been\nfixed. The bug could result in a value that was invalid. It was unlikely\nto ever occur in\nreal-world code, as it involved passing a UTC offset that has never been\nused in any location.\n\n##### Miscellaneous\n\n- The amount of code generated by macros has been massively reduced, on\nthe order of 65-70% for\n  typical use cases of `format_description!`.\n- Significant performance gains for comparisons of `Time`,\n`PrimitiveDateTime`, `UtcDateTime`, and\n`OffsetDateTime`. The first three have gains of approximately 85% (i.e.\n6× faster).\n- Nearly all methods are `#[inline]`.\n\n</details>\n\n---\n\n### Configuration\n\n📅 **Schedule**: Branch creation - At any time (no schedule defined),\nAutomerge - At any time (no schedule defined).\n\n🚦 **Automerge**: Enabled.\n\n♻ **Rebasing**: Whenever PR becomes conflicted, or you tick the\nrebase/retry checkbox.\n\n🔕 **Ignore**: Close this PR and you won't be reminded about this update\nagain.\n\n---\n\n- [ ] <!-- rebase-check -->If you want to rebase/retry this PR, check\nthis box\n\n---\n\nThis PR was generated by [Mend Renovate](https://mend.io/renovate/).\nView the [repository job\nlog](https://developer.mend.io/github/dbus2/zbus).\n\n<!--renovate-debug:eyJjcmVhdGVkSW5WZXIiOiI0MS45MS4xIiwidXBkYXRlZEluVmVyIjoiNDEuOTEuMSIsInRhcmdldEJyYW5jaCI6Im1haW4iLCJsYWJlbHMiOltdfQ==-->\n\nCo-authored-by: renovate[bot] <29139614+renovate[bot]@users.noreply.github.com>",
