          "message": "⬆️ micro: Update time to v0.3.43 (#1490)\n\nThis PR contains the following updates:\n\n| Package | Type | Update | Change |\n|---|---|---|---|\n| [time](https://time-rs.github.io)\n([source](https://redirect.github.com/time-rs/time)) |\nworkspace.dependencies | patch | `0.3.42` -> `0.3.43` |\n\n---\n\n### Release Notes\n\n<details>\n<summary>time-rs/time (time)</summary>\n\n###\n[`v0.3.43`](https://redirect.github.com/time-rs/time/blob/HEAD/CHANGELOG.md#0343-2025-09-02)\n\n[Compare\nSource](https://redirect.github.com/time-rs/time/compare/v0.3.42...v0.3.43)\n\n##### Added\n\n- Support for `rand` 0.9\n\n##### Fixed\n\n- In the `convert` module, any use of `per` with types that were not the\nsame (such as\n`Nanosecond::per(Second)`) would not compile due to a bug. This has been\nfixed.\n\n</details>\n\n---\n\n### Configuration\n\n📅 **Schedule**: Branch creation - At any time (no schedule defined),\nAutomerge - At any time (no schedule defined).\n\n🚦 **Automerge**: Enabled.\n\n♻ **Rebasing**: Whenever PR becomes conflicted, or you tick the\nrebase/retry checkbox.\n\n🔕 **Ignore**: Close this PR and you won't be reminded about this update\nagain.\n\n---\n\n- [ ] <!-- rebase-check -->If you want to rebase/retry this PR, check\nthis box\n\n---\n\nThis PR was generated by [Mend Renovate](https://mend.io/renovate/).\nView the [repository job\nlog](https://developer.mend.io/github/dbus2/zbus).\n\n<!--renovate-debug:eyJjcmVhdGVkSW5WZXIiOiI0MS45MS4xIiwidXBkYXRlZEluVmVyIjoiNDEuOTEuMSIsInRhcmdldEJyYW5jaCI6Im1haW4iLCJsYWJlbHMiOltdfQ==-->\n\nCo-authored-by: renovate[bot] <29139614+renovate[bot]@users.noreply.github.com>",
